import React from "react";
import { Routes, Route } from "react-router-dom"


export default function Navbar() {
    return (
        <div>
            <Routes>
                <Route
                    path="/profile"
                    element={<Profile />}
                />
                <Route
                    path="public"
                    element={<Public />}
                />
            </Routes>
        </div>
    )
}
